import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const cars = [
  {sn:1234, model:'Civic', man:'honda', year:2016},
  {sn:1234, model:'Mustang', man:'Ford', year:2019},
  {sn:1234, model:'3', man:'Mazda', year:2012},
  {sn:1234, model:'S Class', man:'Mersedes', year:2005},
  {sn:1234, model:'Evolution', man:'Mitsubishi', year:2014}
];

function renderCard(car){
  return (
  <div className='car'>
    <h2>Serial Number: {car.sn}</h2>
    <h3>Model: {car.model}</h3>
    <h3>Manufacture: {car.man}</h3>
    <h4>Year: {car.year}</h4>
  </div>
  );
}

cars.map = (e, i) => {

}

cars.forEach(element => {
  let div = React.createElement('div', {className:'cards'}, renderCard(element));
  ReactDOM.render(div, document.querySelector('#root'));
});
